import "./App.css";
import "./index.css";
import Moscu from "./Images/moscu.jpg";

function App() {
  return (
    <div className="App bg-white">
      <div>
        <img className="w-7/12 ms-72 absolute" src={Moscu} alt="moscu" />
        <div>
          <button class="bg-blue-500 hover:bg-blue-700 absolute max-h-fit text-white font-bold py-2 px-4 rounded ">
            BOOK YOUR TABLE
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
